import{_ as l,c as a,F as i,r as o,f as n,o as e,t as d,d as b}from"./app.ddef92e1.js";const f={data(){return{blogs:{"2020-04-22":{date:"2020-04-22T00:00:00.000Z",title:"uxTOMMY",titleTemplate:"Earthrise",description:"Celebrating Earth Day's 50th Anniversity",customDate:"22 Apr 2020",aside:!1,tags:["monologue","science"],iso8601Date:"2020-04-21T17:00:00-07:00",basename:"2020-04-22"},"2020-12-28":{date:"2020-12-28T00:00:00.000Z",title:"uxTOMMY",titleTemplate:"2020 Annual Net Worth Review",description:"First Job Out of College!",customDate:"28 Dec 2020",aside:!1,tags:["finance"],iso8601Date:"2020-12-27T16:00:00-08:00",basename:"2020-12-28"},"2021-12-28":{date:"2021-12-28T00:00:00.000Z",title:"uxTOMMY",titleTemplate:"2021 Annual Net Worth Review",description:"Bought New Car with DOGECOIN!",customDate:"28 Dec 2021",aside:!1,tags:["finance"],iso8601Date:"2021-12-27T16:00:00-08:00",basename:"2021-12-28"},"2022-12-28":{date:"2022-12-28T00:00:00.000Z",title:"uxTOMMY",titleTemplate:"2022 Annual Net Worth Review",description:"Moved to Las Vegas!",customDate:"28 Dec 2022",aside:!1,tags:["finance"],iso8601Date:"2022-12-27T16:00:00-08:00",basename:"2022-12-28"},"2023-12-28":{date:"2023-12-28T00:00:00.000Z",title:"uxTOMMY",titleTemplate:"2023 Annual Net Worth Review",description:"Slow & Steady",customDate:"28 Dec 2023",aside:!1,tags:["finance"],iso8601Date:"2023-12-27T16:00:00-08:00",basename:"2023-12-28"},"2024-06-05":{date:"2024-06-05T00:00:00.000Z",title:"uxTOMMY",titleTemplate:"100 Questions",description:"Fun facts about me",customDate:"05 Jun 2024",aside:!1,tags:["biography"],iso8601Date:"2024-06-04T17:00:00-07:00",basename:"2024-06-05"},"2024-12-28":{date:"2024-12-28T00:00:00.000Z",title:"uxTOMMY",titleTemplate:"2024 Annual Net Worth Review",description:"$100k net worth! 800 credit score!",customDate:"28 Dec 2024",aside:!1,tags:["finance"],iso8601Date:"2024-12-27T16:00:00-08:00",basename:"2024-12-28"}}}}},T=JSON.parse('{"title":"uxTOMMY","titleTemplate":"100 Questions","description":"Fun facts about me","frontmatter":{"date":"2024-06-05T00:00:00.000Z","title":"uxTOMMY","titleTemplate":"100 Questions","description":"Fun facts about me","customDate":"05 Jun 2024","aside":false,"tags":["biography"]},"headers":[],"relativePath":"blogs/2024-06-05.md"}'),u=n("<h1 data-v-28fb3651>100 Questions</h1><br data-v-28fb3651><h2 data-v-28fb3651>June 05, 2024</h2><ol data-v-28fb3651><li data-v-28fb3651> Q. What is your favorite movie? <br data-v-28fb3651> A. The Pursuit of Happyness. It was shown to my class in 7th grade, and it changed my life. </li><li data-v-28fb3651> Q. What are your favorite movie genres? <br data-v-28fb3651> A. Cerebral / Biopics </li><li data-v-28fb3651> Q. Who is your favorite actor? <br data-v-28fb3651> A. Denzel Washington </li><li data-v-28fb3651> Q. What are your favorite videogames? <br data-v-28fb3651> A. Minecraft / Mega Man Maverick Hunter X </li><li data-v-28fb3651> Q. What are your favorite videogame platforms? <br data-v-28fb3651> A. PC / GameBoy Advance </li><li data-v-28fb3651> Q. What is your biggest dream? <br data-v-28fb3651> A. To retire young and live a stress-free life. </li><li data-v-28fb3651> Q. Who is your favorite designer? <br data-v-28fb3651> A. Jony Ive. To this day, I think iOS 7 had the greatest design system of any piece of software ever. He was also responsible for the trend of translucent tech products in the late 1990s and early 2000s. </li><li data-v-28fb3651> Q. What is your dream job? <br data-v-28fb3651> A. UI engineer (my current job) </li><li data-v-28fb3651> Q. Are you an introvert or extrovert? <br data-v-28fb3651> A. Definitely introvert </li><li data-v-28fb3651> Q. What is something you splurge on? <br data-v-28fb3651> A. I love luxury mechanical watches. It&#39;s a really expensive passion though. </li><li data-v-28fb3651> Q. What is one of your best memories? <br data-v-28fb3651> A. In 2015, during the last play of Super Bowl XLIX, when the Patriots caught the interception at the 1-yard line and won the game, that was the most excited I&#39;ve ever been. It might be a tie between that and when I found out I landed my dream job as a UI engineer. </li><li data-v-28fb3651> Q. What is your biggest regret? <br data-v-28fb3651> A. Not buying Bitcoin when it was low lol. Also, not learning how to play an instrument as a child. </li><li data-v-28fb3651> Q. What do you like to do on the weekends? <br data-v-28fb3651> A. I like to practice at the gun range and visit the watch boutiques. </li><li data-v-28fb3651> Q. Do you prefer country or city living? <br data-v-28fb3651> A. I don&#39;t like big crowded cities, but I don&#39;t like the boonies either. I prefer suburban cities. </li><li data-v-28fb3651> Q. What are your favorite foods? <br data-v-28fb3651> A. Country fried steak / Apple turnovers </li><li data-v-28fb3651> Q. What is your dream car? <br data-v-28fb3651> A. The first generation Audi R8. It&#39;s peak design. </li><li data-v-28fb3651> Q. Who are your favorite musical artists? <br data-v-28fb3651> A. Lil Wayne / The Weeknd / A$AP Rocky </li><li data-v-28fb3651> Q. What is your favorite animal? <br data-v-28fb3651> A. Raccoon </li><li data-v-28fb3651> Q. What is your favorite sport to watch? <br data-v-28fb3651> A. Red Bull hosts a sport called &quot;Soapbox&quot; every year where people build motor-less vehicals and compete in a downhill race. It&#39;s absolutely ridiculous. </li><li data-v-28fb3651> Q. What is your favorite fashion brand? <br data-v-28fb3651> A. Burberry </li><li data-v-28fb3651> Q. What are your favorite songs? <br data-v-28fb3651> A. Aurora - Runaway / Modest Mouse - Float On </li><li data-v-28fb3651> Q. What are your favorite songs? <br data-v-28fb3651> A. Aurora - Runaway / Modest Mouse - Float On </li><li data-v-28fb3651> Q. What are your favorite music genres? <br data-v-28fb3651> A. Rap / R&amp;B </li><li data-v-28fb3651> Q. What is your favorite book? <br data-v-28fb3651> A. Rich Dad Poor Dad by Robert Kiyosaki </li><li data-v-28fb3651> Q. Who is your favorite visual artist? <br data-v-28fb3651> A. Hajime Sorayama </li><li data-v-28fb3651> Q. What is your favorite joke? <br data-v-28fb3651> A. Why was six afraid of seven? Because eight nine ten </li><li data-v-28fb3651> Q. What is your favorite show? <br data-v-28fb3651> A. HBO Silicon Valley </li><li data-v-28fb3651> Q. What do you want to experience before you die? <br data-v-28fb3651> A. I want to live long enough to see humanity on Mars. </li><li data-v-28fb3651> Q. What is your favorite music album? <br data-v-28fb3651> A. The Weeknd - After Hours / Aurora - All My Demons Greeting Me as a Friend </li><li data-v-28fb3651> Q. Who is your favorite super hero? <br data-v-28fb3651> A. Tony Stark / Iron Man </li><li data-v-28fb3651> Q. What do you like most about your career? <br data-v-28fb3651> A. I love that it&#39;s the perfect middle ground between technical and creative. </li><li data-v-28fb3651> Q. Is your glass half-empty or half-full? <br data-v-28fb3651> A. If the glass started out empty and was filled half way, it&#39;s half-full. If the glass was full and had half of its contents removed, then it&#39;s half-empty. </li><li data-v-28fb3651> Q. What three items would you take with you on a deserted island? <br data-v-28fb3651> A. A hammock, a blue lagoon cocktail, and a side-table to put the drink on. I&#39;m not trying to survive as long as possible; I&#39;d just want to enjoy the peace and quiet. </li><li data-v-28fb3651> Q. What is your favorite season of the year? <br data-v-28fb3651> A. Autumn. Perfect temperature. </li><li data-v-28fb3651> Q. What is your favorite scent? <br data-v-28fb3651> A. Probably cinnamon bread. </li><li data-v-28fb3651> Q. What is your favorite ice cream flavor? <br data-v-28fb3651> A. Vanilla. It&#39;s highly underrated because it&#39;s the &quot;default&quot;, but good quality vanilla is actually a pretty complex flavor, and not boring like it&#39;s reputation suggests. </li><li data-v-28fb3651> Q. Cats or Dogs? <br data-v-28fb3651> A. Cats. They&#39;re quieter and lower maintenance. </li><li data-v-28fb3651> Q. If you could snap your fingers and become an expert in something, what would it be? <br data-v-28fb3651> A. An expert pianist. </li><li data-v-28fb3651> Q. Coffee or Tea? <br data-v-28fb3651> A. Both. I love matcha green tea, but I also enjoy a black cold brew coffee. </li><li data-v-28fb3651> Q. What is your go-to movie theater snack? <br data-v-28fb3651> A. Swedish Fish or any kind of gummy. They aren&#39;t messy, and they don&#39;t make a lot of noise. </li><li data-v-28fb3651> Q. What is your favorite kind of sandwich? <br data-v-28fb3651> A. Chicken caprese on ciabatta bread </li></ol>",4),v={key:0,id:"tags"},h={id:"tagPills"};function c(y,m,p,g,r,A){return e(),a("div",null,[u,(e(!0),a(i,null,o(r.blogs,t=>(e(),a("div",null,[t.basename=="2024-06-05"?(e(),a("span",v,[(e(!0),a(i,null,o(t.tags,s=>(e(),a("span",h,d(s),1))),256))])):b("",!0)]))),256))])}const Q=l(f,[["render",c],["__scopeId","data-v-28fb3651"]]);export{T as __pageData,Q as default};
